import { FormControl, FormGroup, InputLabel, Input, Typography, Button } from '@mui/material';
import styled from '@emotion/styled';
import { addSubmissionType } from '../service/api';

const Container = styled(FormGroup)`
    width:50%;
    margin: 5% 30%;
    & > div {
        margin-top:20px;
    }
`
const defaultAddSubmission = {
     name:'',
     type:''
}

const AddSubmissionType = () => {

    const [submitionType, setSubmissionType] = useState(defaultAddSubmission);

    const onValueChange = (e) => {
        setSubmissionType({...submitionType,[e.target.name]:e.target.value});
    }

    const AddSubmittionType = () => {

    }

    return(
        <Container>
            <Typography variant='h4'>Add Submission Types</Typography>
            <FormControl>
                <InputLabel>Name</InputLabel>
                <Input onChange={(e)=> onValueChange(e)} name="name"/>
            </FormControl>
            <FormControl>
                <InputLabel>Type</InputLabel>
                <Input onChange={(e)=> onValueChange(e)} name="type"/>
            </FormControl>
            <FormControl>
            <Button variant="contained" onClick={() => AddSubmittionType()}>Add Submission Type</Button>
            </FormControl>
        </Container>
        )

}

export default AddSubmissionType;
